import os
import re

def rename_audio_files(audio_dir, html_tags):
    """
    Renames audio files in a directory based on tags extracted from HTML.

    Args:
        audio_dir (str): Path to the directory containing audio files.
        html_tags (list): A list of tags extracted from HTML.
    """

    for filename in os.listdir(audio_dir):
        if filename.endswith((".mp3", ".wav")):
            match = re.search(r"mateo_19182 - (.*?) \[", filename)
            if match:
                base_name = match.group(1).strip()
                match_tags = re.findall(r"\[(.*?)\]", filename)
                
                # Add new tags from HTML to the file
                new_filename_parts = ["mateo_19182 - " + base_name] + [f"[{tag}]" for tag in match_tags] + [f"[{tag}]" for tag in html_tags] + [filename[filename.rfind("."):]]
                new_filename = " ".join(new_filename_parts)

                old_filepath = os.path.join(audio_dir, filename)
                new_filepath = os.path.join(audio_dir, new_filename)

                # Skip if the new filename would be identical to the old one
                if new_filename == filename:
                    print(f"Skipping {filename} (no changes needed)")
                    continue

                try:
                    os.rename(old_filepath, new_filepath)
                    print(f"Renamed: {filename} -> {new_filename}")
                except FileExistsError:
                    print(f"File already exists: {new_filename}")
                except Exception as e:
                    print(f"Error renaming {filename}: {e}")

def extract_tags_from_html(html_string):
    """
    Extracts tags from HTML and returns a list of tags.
    """
    pattern = r"<ot-op-tag.*?><div.*?><span.*?>(.*?)<\/span>"
    tags = re.findall(pattern, html_string)
    return tags

def process_html_and_rename(audio_dir, html_string):
    """
    Process HTML to extract tags and apply them to all audio files in the directory.
    """
    tags = extract_tags_from_html(html_string)
    
    # Write HTML data to a text file for debugging/reference
    with open('html_data.txt', 'w', encoding='utf-8') as f:
        f.write("\n\nExtracted tags:\n")
        f.write("\n".join(tags))
    
    print(f"Found {len(tags)} tags from HTML")
    rename_audio_files(audio_dir, tags)

